import { styled, css } from "styled-components";

export const Container = styled.div`
  width: 390px;
  height: 844px;
  margin: 0 auto;
  background: #121212;
  justify-content: center;
  align-items: center;
  display: flex;
  flex-direction: column;
  overflow: hidden;
`;

export const TopBar = styled.div`
  display: flex;
  align-items: center;
  gap: 135px;
  margin-top: -480px;
`;

export const BackBtn = styled.button`
  width: 29px;
  height: 30px;
  background-image: url("/images/BackBtn.svg");
  background-color: transparent;
  background-repeat: no-repeat;
  border: none;
  cursor: pointer;
  outline: none;
`;

export const GroupSmall = styled.div`
  width: 45px;
  height: 27px;
`;

export const MyPage = styled.button`
  width: 25px;
  height: 27px;
  cursor: pointer;
  background-image: url("/images/MyPage.svg");
  background-color: transparent;
  border: none;
  outline: none;
`;

export const ProfileContainer = styled.div`
  display: flex;
  gap: 30px;
  margin-top: 0%;
`;

export const BlackCirclePurple = styled.div`
  width: 137px;
  height: 138px;
  margin-left: 126px;
  margin-top: 60px;
  fill: #121212;
  stroke: #a259ff;
  background-image: url("/images/BlackCirclePurple.svg");
  background-color: transparent;
  border: none;
  outline: none;
`;

export const NameContainer = styled.div`
  width: 142.558px;
  height: 34px;
  flex-shrink: 0;
  border-radius: 8px;
  border: 1px solid #a259ff;
  background: #121212;
`;

export const NameText = styled.div`
  width: 61.315px;
  height: 18px;
  flex-shrink: 0;
  color: #fff;
  font-family: Barlow;
  font-size: 12px;
  font-style: normal;
  font-weight: 400;
  line-height: 160.5%;
`;
